INSERT INTO `negotiations` VALUES (11278, 2951, 15, 'Instagram', 'Distribuidor', 'Catalago', '', '2023-04-03', 2, 'Cliente respondeu informando que gostaria de saber mais sobre forma de pagamento e de envio pois já sofreu 3 golpes diferentes e tem receio, passei todas as informações sobre entrega e pagamento, mandei vídeo e a mesma não respondeu mais. segundo contato encaminhado.', '2023-03-27 17:41:08', '2023-03-27 17:41:08');
INSERT INTO `negotiations` VALUES (11279, 2966, 15, 'Instagram', 'Distribuidor', 'Orçamento', '', '2023-04-03', 2, 'Cliente bem interessada, fiz toda a apresentação, o encantamento e a mesma montou um orçamento, passei pra ela junto com a a cotação e segundo ela ainda não possui o valor, diz que estava aguardando uma resposta, depois não retornou mais. segundo contato encaminhado.', '2023-03-27 17:55:41', '2023-03-27 17:55:41');
INSERT INTO `negotiations` VALUES (11280, 2972, 15, 'Instagram', 'Distribuidor', 'Catalago', '', '2023-04-04', 2, 'Cliente não demonstra muito interesse, respondeu um &#34;ok&#34; no início da conversa e depois não retornou mais, ouviu somente os  3 primeiros áudios. Encaminhado segundo contato.', '2023-03-27 17:58:42', '2023-03-27 17:58:42');
INSERT INTO `negotiations` VALUES (11281, 3033, 7, 'Indicação', 'Outros', 'Apresentação', 'NRespondeu', '2023-09-20', 2, 'Fiz a apresentação, não visualizou e não atende a ligação. ', '2023-03-28 11:05:33', '2023-03-28 11:05:33');
INSERT INTO `negotiations` VALUES (11282, 2981, 15, 'Instagram', 'Distribuidor', 'Catalago', '', '2023-04-07', 2, 'Não obtive retorno algum do candidato, nem ao menos foram reproduzidos os áudios. Encaminhado segundo contato', '2023-03-28 11:07:28', '2023-03-28 11:07:28');
INSERT INTO `negotiations` VALUES (11283, 2996, 15, 'Instagram', 'Distribuidor', 'Catalago', '', '2023-04-07', 2, 'Não obtive retorno algum do candidato, as mensagens chegaram a serem visualizadas e o mesmo somente disse um &#34;ok&#34; no início, depois nada mais. nenhum áudio foi reproduzido. Encaminhado segundo contato.', '2023-03-28 11:14:15', '2023-03-28 11:14:15');
INSERT INTO `negotiations` VALUES (11284, 3003, 15, 'Instagram', 'Distribuidor', 'Apresentação', '', '2023-04-07', 2, 'Candidata chegou a dar um retorno informando que já foi revendedora de joias e que gostaria de trabalhar com algo diferente. iniciei a apresentação e não tive mais retorno. Encaminhado segundo contato.', '2023-03-28 11:21:37', '2023-03-28 11:21:37');
