INSERT INTO `negotiations` VALUES (11288, 2830, 15, 'Instagram', 'Salão', 'Orçamento', '', '2023-04-07', 3, 'Cliente bem interessada, retornou no segundo contato, finalizei a apresentação e cheguei a passar o orçamento mas a mesma informa não ter o valor de investimento no momento. encaminhado terceiro contato. ', '2023-03-28 12:06:48', '2023-03-28 12:06:48');
INSERT INTO `negotiations` VALUES (11289, 3014, 15, 'Instagram', 'Outros', 'Tabela', '', '2023-04-07', 2, 'Candidata deu um retorno razoável, informando que é profissional e sua especialidade, diz que não estava conseguindo abrir o catálogo, devido a isso enviei a tabela, depois a mesma não deu mais retorno. encaminhado segundo contato.', '2023-03-28 14:17:20', '2023-03-28 14:17:20');
INSERT INTO `negotiations` VALUES (11290, 2829, 15, 'Instagram', 'Salão', 'Apresentação', 'NRespondeu', '2023-04-28', 3, 'No segundo contato candidata(o) responde informando que demoramos 15 dias para responder, o que não procede já que assim que a mesma entrou em contato, foi passado pro funil e chamei no mesmo dia, questionei e ela (ou ele pois não se apresentou) não quis prosseguir e disse que não tem mais interesse para deixar pra lá, sem ao menos eu ter uma abertura para a conversa, logo após me bloqueou.', '2023-03-28 14:28:31', '2023-03-28 14:28:31');
INSERT INTO `negotiations` VALUES (11291, 2814, 15, 'Instagram', 'Salão', 'Proposta', '', '2023-04-10', 3, 'Cliente deu um retorno no primeiro contato mesmo, se mostrou muito interessada ouvindo toda a minha apresentação, a mesma perguntou sobre o que precisa para se tornar salão parceiro, passei a proposta mas não tive retorno, a mesma ouviu os meus áudios no segundo contato e não respondeu. Encaminhado terceiro contato.', '2023-03-28 14:59:52', '2023-03-28 14:59:52');
INSERT INTO `negotiations` VALUES (11292, 1116, 11, 'Instagram', 'Salão', 'Apresentação', 'NRespondeu', '2023-10-30', 3, 'Apresentação cliente não responde as msgs \n', '2023-03-28 15:23:17', '2023-03-28 15:23:17');
