INSERT INTO `negotiations` VALUES (11299, 2690, 15, 'Instagram', 'Distribuidor', 'Cotação', '', '2023-04-18', 3, 'Cliente retornou informando que não possui condições de compra ainda, e que assim que pudesse entraria em contato. informei agradeci e fiquei a disposição, e agora retomei o contato pela quinta vez para saber da situação.', '2023-03-28 17:22:08', '2023-03-28 17:22:08');
INSERT INTO `negotiations` VALUES (11300, 2762, 15, 'Instagram', 'Salão', 'Catalago', '', '2023-04-20', 3, 'Cliente não dá um retorno, somente visualiza as mensagens, uma única vez no segundo contato a mesma visualizou o áudio somente, porém nada mais. quarto contato encaminhado.', '2023-03-28 17:32:39', '2023-03-28 17:32:39');
INSERT INTO `negotiations` VALUES (11301, 3022, 15, 'Instagram', 'Salão', 'Catalago', '', '2023-04-10', 2, 'Cliente não retornou primeiro contato, sem acesso a visualização e o histórico pois a mesma usa tempo de duração das mensagens temporária. Encaminhado segundo contato.', '2023-03-28 17:40:09', '2023-03-28 17:40:09');
INSERT INTO `negotiations` VALUES (11302, 3026, 15, 'Instagram', 'Distribuidor', 'Proposta', '', '2023-04-10', 2, 'Candidata chamada Daiane, deu um bom retorno logo no primeiro contato, ouviu toda a apresentação e informa que já trabalhou com a Paris, cheguei a passar a tabela e proposta pois a mesma interagiu bem e ficou de mandar o pedido. Encaminhado segundo contato para saber sobre.', '2023-03-28 17:48:25', '2023-03-28 17:48:25');
INSERT INTO `negotiations` VALUES (11303, 2708, 15, 'Instagram', 'Distribuidor', 'Catalago', 'Investimento', '2023-04-29', 3, 'Cliente respondeu no segundo contato informando que não tem condições de investimento, passou uma imagem de que nos contatou somente por curiosidade, a mesma informa que irá deixar o contato salvo para quando tiver disponibilidade chamar. Deixei em aberto para conversarmos sobre valores e até mesmo compra no varejo para não perder a venda e informei que estarei a disposição, sem mais retornos. quarto contato encaminhado. ', '2023-03-29 09:25:09', '2023-03-29 09:25:09');
INSERT INTO `negotiations` VALUES (11304, 2795, 15, 'Instagram', 'Salão', 'Catalago', '', '2023-04-12', 2, 'Cliente chamada Andreia, de primeiro não ouviu os primeiros áudios, no outro dia ouviu parte dos meus e retornou informando que é profissional da área porém nova no ramo, segui apresentando e com o processo de encantamento e a mesma não retornou mais. segundo contato encaminhado. ', '2023-03-29 10:06:53', '2023-03-29 10:06:53');
